import React from 'react'
import {Container, Nav, NavBar, NavbarBrand, NavbarCollapse, Button} from 'react-bootstrap'
import logo from '../Components/logo-og.png'
import { useNavigate } from 'react-router-dom';

const NewPage = () => {
	const navigate = useNavigate();

	const handleLogOut = () => {

		navigate('/form.jsx');
  };

	return (
	<NavBar bg = 'dark' variant = 'dark'>
		<Container>

			<NavbarBrand href = './NewPage'>
				<img src = {logo} 
				height = '30'
				width= '30'
				className='d-inline-block align-top'
				alt='logo' />
			</NavbarBrand>

			<NavbarCollapse id='responsive-navbar-nav'>

				<Nav className='mr-auto'>

					<Nav.Link href = '/'>
						Home
					</Nav.Link>

				</Nav>

					<Button variant = "danger" onClick = {handleLogOut}>
						Log Out
					</Button>

			</NavbarCollapse>
		</Container>
	</NavBar>
	)

};

export default NewPage;
